    const FollowerData = [{ nickname: 강똘똘 }];
    return (
        <>
            <AppLayout>
                <NicknameEdit />
                <FollowList header="팔로잉 목록" data={FollowingData} />
                <FollowList header="팔로워 목록" data={FollowerData} />
